<?php

class Test {

    protected $app;

    public function __construct()
    {
        require_once '../vendor/autoload.php';

        $this->app = \funcode\App::instance();
    }

    public function ocr()
    {
        try {
            $result = $this->app->duguang->general('data:image/png;base64,');
            if (!$result) {
                return;
            }
        } catch (\funcode\exception\FuncodeException $e) {
            var_dump('error : ' . $e->getMessage());return;
        }

        var_dump($result->get());
        var_dump($result->content());
        var_dump($result->contentWrap());

        file_put_contents('tst.txt' , $result->contentWrap());
    }
}

$tengxunAi = new Test();

$tengxunAi->ocr();
